   "source": [
    "plotdata4 <- Marriage %>%\n",
    "    count(race) %>%\n",
    "    arrange(desc(race)) %>%\n",
    "    mutate(prop=round(n*100 / sum(n), 1), lab.ypos= cumsum(prop) - 0.5*prop)\n",
    "\n",
    "ggplot(plotdata4, aes(x = \"\", y = prop, fill = race))+\n",
    "    geom_bar(width = 1, stat = \"identity\", color = \"black\")+\n",
    "    coord_polar(\"y\", start = 0, direction = -1) +\n",
    "theme_void()"
   ]
